import React from 'react';
import {Button, styled, Typography} from '@mui/material';

function App() {

const ButtonStyle = styled(Button)
({
  background: "red",
  color: "#fff",
  "&:hover":{
    opacity: 0.7
  }
})
  return (
    <div>
      <Button variant="text">Text</Button>
      <Button variant="contained" sx={{
        background: "red",
        color: "#fff",
        "&:hover":{
          opacity: 0.7
        }
      }}>Contained</Button>
      <ButtonStyle>Works</ButtonStyle>
    </div>
  );
}

export default App;
